pragma solidity ^0.5.0;

import "./Customer.sol";

contract CustomerFactory {
    address owner;
    address controller;
    
    uint customerCount;
    mapping(uint => address) customers;
    
    constructor() public
    {
        controller = msg.sender;
        owner = tx.origin;
        customerCount = 0;
    }
    
    function makeCustomer(string calldata name, string calldata contactNumber) external returns(address customer){
        customerCount++;
        Customer newCustomer = new Customer(customerCount, name, contactNumber);
        customers[customerCount] = address(newCustomer);
        return address(newCustomer);
    }
    
    function customerExists(address restaurant) public view returns(bool CustomerExists){
	    for(uint i = 0; i < customerCount;i++){
	        if(customers[i+1] == restaurant){
	            return true;
	        }
	    }
	    return false;
	}
}
